“Pumpkin pie” cheese and crackers! As soon as I saw @theboardloon make these I fell in love. How perfect are these for a quick and easy Thanksgiving appetizer?!

Here’s what you’ll need:
Cheddar cheese slices
@kelloggsus Town House pita crackers
@nabiscosnacks Chicken in a Biskit crackers
@phillycreamchs whipped cream cheese (this is your “glue” and the “whipped cream” on top!)

Go check out @theboardloon’s reel on her page! I love all her content. Thank you Kelsey for the genius idea 🧡

